import React, { Component } from "react";
import { BrowerRouter as Router, Route } from "react-router-dom";
import HomePage from "./pages/HomePage";
import "./App.css";

class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
          <HomePage />
        </div>
      </Router>
    );
  }
}

export default App;
